INSERT INTO `ocorrencia` VALUES (137,27,'Costureiro de vestimenta','Sou costureiro especializado em roupas sociais, confeccionando, ajustando e reformando peças como ternos, blazers, calças, camisas e vestidos sob medida.','DOACAO','Servicos','RJ, Rua Londres',NULL,_binary '[\"data:image/webp;base64,\"]','2025-10-20 19:13:32','2025-10-20 19:13:32');
INSERT INTO `ocorrencia` VALUES (138,35,'Reparo de computadores','Ofertamos um de nossos técnicos de serviço para o conserto de um computador, afim de gerar experiência para o mesmo técnico recém ingressado na área. Basta trazer o computador ao local informado.','DOACAO','Servicos','AM, Rua Barão de São Domingos',NULL,_binary '[\"data:image/jpeg;base64,\",\"data:image/jpeg;base64,\"]','2025-10-20 19:22:18','2025-10-20 19:22:18');
INSERT INTO `ocorrencia` VALUES (139,34,'Buscamos placas de vídeo queimadas','Estamos fazendo um apanhado de placas de vídeo queimadas para reaproveitarmos afim de garantir uma funcional através da reciclagem dos materiais aproveitados.','PEDIDO','Servicos','PA, Avenida Presidente Vargas',NULL,_binary '[\"data:image/png;base64,\"]','2025-10-20 19:28:54','2025-10-20 19:28:54');
INSERT INTO `ocorrencia` VALUES (140,31,'Doação de placa de vídeo queimada','Minha placa de vídeo queimou, e busco doar a quem seja de uso.\nÉ uma radeon rx 550 4gb','DOACAO','eletronicos','AM, Rua Barão de São Domingos',NULL,_binary '[\"data:image/jpeg;base64,\"]','2025-10-20 19:36:11','2025-10-20 19:36:11'),(141,29,'Preciso costurar um blazer de formatura','Me formo no próximo mês, mas meu blazer social, o único que tenho, abriu uma pequena falha na axila. Busco um costureiro que possa me ajudar.','PEDIDO','roupas','MG, Praça Sete de Setembro',NULL,_binary '[\"data:image/jpeg;base64,\"]','2025-10-20 19:40:06','2025-10-20 19:40:06'),(142,30,'Computador de estudo não liga mais','Meu único computador em casa, já antigo, que uso para estudar, parou de ligar na última noite enquanto eu estudava. O ENEM se aproxima, preciso consertar, mas não tenho fundos...','PEDIDO','eletronicos','PA, Avenida Presidente Vargas',NULL,_binary '[\"data:image/webp;base64,\"]','2025-10-20 19:45:07','2025-10-20 19:45:07');
